import React, { useEffect, useState } from "react";
import axios from "axios";
import Navbar from './Navbar';
import '../assets/css/Dashboard.css';
import styles from '../assets/css/Auth.module.css';
import ExpenseTracking from './ExpenseTracking';
import IncomeManagement from './IncomeManagement';
import BudgetAllocation from './BudgetAllocation';
import Reports from './Reports';
import Settings from './Settings';
import MyPocketAI from './MyPocketAI';
import { Routes, Route, Link, useNavigate } from 'react-router-dom';

function Dashboard() {
  const navigate = useNavigate();
  const [userData, setUserData] = useState(null);
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(true); // Manage loading state

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
    }
  }, [navigate]);

  useEffect(() => {
    const fetchUserData = async () => {
      try {
        const token = localStorage.getItem("token");
        if (!token) {
          // If the token doesn't exist, redirect to login
          navigate("/login");
          return;
        }

        const res = await axios.get("http://localhost:3001/api/auth/user-details", {
          headers: { Authorization: `Bearer ${token}` },
        });

        setUserData(res.data); // Set the fetched user data
      } catch (err) {
        // Handle error from API
        setError(err.response?.data?.message || "Failed to fetch user details.");
      } finally {
        setLoading(false); // Stop loading after the API call completes
      }
    };

    fetchUserData();
  }, [navigate]); // Dependency on navigate to handle redirects

  if (loading) {
    return <div>Loading...</div>; // Show a loading state while fetching data
  }

  if (error) {
    return <div>Error: {error}</div>; // Show error if there was an issue
  }
  return (
    <div className="App-dashboard">
      <Navbar />
      <div className="dashboard-content">
        <div className="dashboard-sidebar">
          {error && <p className={styles.error}>{error}</p>}
          {userData ? (
            <div className="userdata">
              <p>Name: <span>Test User</span></p>
              <p>Email: <span>test@mypocketai.tech</span></p>
            </div>
            ) : (
              <p>Loading user data...</p>
            )}
            <ul className="dashboard-menu">
              <li><Link to="/dashboard/expense-tracking">üí∞ Expense Tracking</Link></li>
              <li><Link to="/dashboard/income-management">üìà Income Management</Link></li>
              <li><Link to="/dashboard/budget-allocation">üìä Budget Allocation</Link></li>
              <li><Link to="/dashboard/reports">üìú Reports & Insights</Link></li>
              <li><Link to="/dashboard/ai-assistance">ü§ñ My Pocket AI</Link></li>
              <li><Link to="/dashboard/settings">‚öôÔ∏è Settings</Link></li>
              <li><Link to="/logout">Logout</Link></li>
            </ul>
        </div>

        <div className="dashboard-main">
          <Routes>
            <Route path="/" element={<Reports />} />
            <Route path="/expense-tracking" element={<ExpenseTracking />} />
            <Route path="/income-management" element={<IncomeManagement />} />
            <Route path="/budget-allocation" element={<BudgetAllocation />} />
            <Route path="/reports" element={<Reports />} />
            <Route path="/ai-assistance" element={<MyPocketAI />} />
            <Route path="/settings" element={<Settings />} />
          </Routes>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
